import React from 'react';
import './Home.css';

function Home() {
  return (
    <div className="home">
      {/* Video Background */}
      <video autoPlay loop muted className="background-video">
        <source src="/h2.mp4.mp4" type="video/mp4" />
        Your browser does not support the video tag.
      </video>
      
      {/* Glassmorphism content box */}
      <div className="content">
        <h1>Welcome to Health&me</h1>
        <p>Your personal guide to food logging, exercise tracking, and more!</p>
      </div>
    </div>
  );
}

export default Home;
